import { Routes, Route, BrowserRouter } from 'react-router-dom'
import Index from '../paginas'
function Rotas() {
    return (
        <BrowserRouter>
            <Routes>
                <Route exact path='/' elements={<Index />} />
            </Routes>
        </BrowserRouter>
    )
}
export default Rotas
